selector_to_html = {"a[href=\"#scatterplot\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.1.1. </span>Scatterplot<a class=\"headerlink\" href=\"#scatterplot\" title=\"Permalink til denne overskrift\">#</a></h2><p>For at komme et skridt n\u00e6rmere p\u00e5 at forst\u00e5, om vores data udviser en form for tendens, kan vi plotte vores datapunkter mod hinanden. Det g\u00f8r vi i et s\u00e5kaldt <em>scatterplot</em>. Lad os vise dette med et eksempel.</p>", "a[href=\"#hoejde-og-skostoerrelse-scatter\"]": "<div class=\"proof eksempel admonition\" id=\"hoejde-og-skostoerrelse-scatter\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 25.1 </span></p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Vi f\u00e5r til opgave at unders\u00f8ge, om der er en sammenh\u00e6ng mellem h\u00f8jder og skost\u00f8rrelser p\u00e5 elever i en klasse p\u00e5 et gymnasium. Vi indsamler f\u00f8lgende data, som er gemt i filen <a class=\"reference download internal\" download=\"\" href=\"../../../_downloads/59274044c1ba5dd6441448be2ab53ef3/eks_hoejde-og-skostoerrelse.xlsx\"><code class=\"xref download docutils literal notranslate\"><span class=\"pre\">eks_hoejde-og-skostoerrelse.xlsx</span></code></a></p>\n<table class=\"colwidths-auto table\">\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>H\u00f8jde i cm</p></th>\n<th class=\"head\"><p>Skost\u00f8rrelse</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p>182.3</p></td>\n<td><p>43</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>184.4</p></td>\n<td><p>44</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>168.1</p></td>\n<td><p>39</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><span class=\"math notranslate nohighlight\">\\(\\vdots\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\vdots\\)</span></p></td>\n</tr>\n</tbody>\n</table>\n<p>Vi lader nu <em>H\u00f8jde i cm</em> v\u00e6re variablen langs <span class=\"math notranslate nohighlight\">\\(x\\)</span>-aksen og <em>Skost\u00f8rrelse v\u00e6re variablen</em> langs <span class=\"math notranslate nohighlight\">\\(y\\)</span>-aksen.</p>\n<figure class=\"align-default\">\n<img alt=\"../../../_images/68fd8fcebaef63ae5b85c015778c7d4424d88cfeb5fe1ab08729fbf8e072e9d6.png\" src=\"../../../_images/68fd8fcebaef63ae5b85c015778c7d4424d88cfeb5fe1ab08729fbf8e072e9d6.png\"/>\n</figure>\n<p>Af scatterplottet bliver det tydeligt, at der er en tendens: Elever, der er h\u00f8jere, bruger ogs\u00e5 st\u00f8rre sko.</p>\n</section>\n</div>", "a[href=\"#korrelationskoefficienten-i\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.1.2. </span>Korrelationskoefficienten I<a class=\"headerlink\" href=\"#korrelationskoefficienten-i\" title=\"Permalink til denne overskrift\">#</a></h2><p>Sammenh\u00e6ng i vores data kan ogs\u00e5 <a class=\"reference internal\" href=\"../../Vaerktoejer/gloser.html#term-kvantificere\"><span class=\"xref std std-term\">kvantificere</span></a>s gennem korrelation. Korrelationskoefficienten er et tal, der siger noget om, hvordan den ene variabel opf\u00f8rer sig i forhold til den anden variabel. Tallet ben\u00e6vnes ofte med det gr\u00e6ske bogstav <span class=\"math notranslate nohighlight\">\\(\\rho\\)</span> (udtales \u00bbrho\u00ab).</p><p>I vores eksempel fra f\u00f8r havde vi, at n\u00e5r den ene variabel var st\u00f8rre, s\u00e5 var den anden variabel ogs\u00e5 st\u00f8rre. Vi siger, at de to variabler er <em>positivt korrelerede</em>. Det modsatte tilf\u00e6lde kan du ogs\u00e5 st\u00f8de p\u00e5. N\u00e5r en variabel bliver mindre, mens den anden variabel bliver st\u00f8rre, s\u00e5 er de to variabler <em>negativt korrelerede</em>. Hvis to variabler udvikler uden en tendens med hinanden, s\u00e5 vil de to variabler v\u00e6re <em>ukorrelerede</em>.</p>", "a[href=\"#datamaessige-sammenhaenge\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.1. </span>Datam\u00e6ssige sammenh\u00e6nge<a class=\"headerlink\" href=\"#datamaessige-sammenhaenge\" title=\"Permalink til denne overskrift\">#</a></h1><p>N\u00e5r vi arbejder med datam\u00e6ssige sammenh\u00e6nge unders\u00f8ger vi potentielle sammenh\u00e6nge i vores indsamlet data. Oftest, n\u00e5r vi arbejder med data p\u00e5 den m\u00e5de, s\u00e5 har vi forud for dataindsamlingen en hypotese for, hvilke sammenh\u00e6nge vi vil se. Eksempelvis, hvis vi gik ud og spurgte rige personer, hvilken bil de k\u00f8rer rundt i, s\u00e5 har vi en forventning om, at det vil v\u00e6re dyre biler. Ind i mellem kan der godt v\u00e6re nogle, der ikke f\u00f8lger den forventning, men i det st\u00f8rre perspektiv, s\u00e5 vil data over indkomst og bilens v\u00e6rdi nok vise, at der er en sammenh\u00e6ng.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
